                        <html><head><meta charset="utf-8"></head><body>
<p>Линейка ВАКА High Quality&nbsp; состоит из 10-ти видов&nbsp;<strong>кормов для попугаев мелких, средних и крупных, канареек, хомяков, шиншилл и других мелких животных</strong>&nbsp;в новом современном оригинальном и привлекательном для розничной торговли типе пакета с проваренными гранями и плоским дном (типа &ldquo;Stabilpack&rdquo;). Такая форма придает упаковке новые потребительские качества, такие, как повышенная жесткость пакета, оригинальный дизайн, прочность швов.</p>
<p>Корма изготовлены из <strong>отборного чистого зерна</strong>. Это полноценные, сбалансированные кормовые смеси, по составу, калорийности и содержанию витаминов максимально приближенные к рациону животных в естественной среде обитания.&nbsp;<br /><br />Польза корма для птиц и грызунов зависит от входящих в его состав компонентов, которые&nbsp;обеспечат питомцу&nbsp;максимальную защиту и профилактику от большинства распространенных заболеваний, а также позволит поддерживать его в отличной форме.</p>
<p>- <em><strong>Йод,</strong></em> содержащийся в фукусе, помогает предотвратить возможные нарушения обмена веществ, заболевания щитовидной железы, развитие зоба;</p>
<p>- <em><strong>Льняное семя,</strong></em> наряду с <em><strong>пробиотиком,&nbsp;</strong></em>улучшают усвоение корма, нормализуют пищеварение, повышают иммунитет;</p>
<p>- <em><strong>Кальций,</strong> </em>добавленный в корм в легко усвояемой для птиц форме, обеспечивает превосходное оперение;</p>
<p>- <em><strong>Конопляное семя</strong></em>&nbsp;повышает активность птички, она будет чаще радовать Вас своим пением;</p>
<p>- <em><strong>Сушеные овощи</strong></em> &ndash; источник столь необходимого&nbsp; каротина, клетчатки и витаминов;</p>
<p>- <em><strong>Семена черного подсолнечника</strong></em> &ndash; дополнительный источник энергии;</p>
<p>- <em><strong>Семена полосатого подсолнечника</strong></em>&nbsp;оберегают Вашу птичку от ожирения;</p>
<p>- <em><strong>Тыквенное семя</strong></em> &ndash; как натуральный антигельментик, очищает организм птицы от внутренних паразитов;</p>
<p>- <em><strong>Сушеные фрукты и орехи</strong></em><span style="font-size: 11px; font-family: Verdana, Arial, Helvetica, sans-serif; color: #000000; text-align: left;">&nbsp;заставят Вашего питомца зажмуриться от удовольствия и обогатят организм витаминами;</span></p>
<p><span style="font-size: 11px; font-family: Verdana, Arial, Helvetica, sans-serif; color: #000000; text-align: left;">- </span><em><strong>Травяные гранулы</strong></em>&nbsp;принесут Вашему любимцу всю пользу свежескошенных трав.</p>
<p>Для волнистых попугаев.</p>
<p><strong>Фасовка:</strong> 500гр.</p>
</body></html>

